import React, { Component } from "react";
import "./Options";
import MLogo from "./images/mlogo.jpg";

class Options extends Component {
    render(){
        return (
            <div className="Options">
                <img src={MLogo} alt="M-Logo"/>
            </div>
        )
    }
}

export default Options;
